import React, { useState, useEffect } from 'react';
import { Container, TextField, Button, Typography, List, ListItem, ListItemText, Paper, Grid, MenuItem, Select, InputLabel } from '@mui/material';
import './App.css';

const App = () => {
  const [classrooms, setClassrooms] = useState([]);
  const [booking, setBooking] = useState({ classroomId: '', startTime: '', endTime: '' });
  const [filters, setFilters] = useState({ location: '', timeSlot: '' });

  useEffect(() => {
    // Fetch available classrooms from the server
    fetch('/api/classrooms')
      .then(response => response.json())
      .then(data => setClassrooms(data));
  }, []);

  const handleBookingChange = (e) => {
    const { name, value } = e.target;
    setBooking(prev => ({ ...prev, [name]: value }));
  };

  const handleBookingSubmit = (e) => {
    e.preventDefault();
    // Send booking request to the server
    fetch('/api/bookings', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(booking),
    })
      .then(response => response.json())
      .then(data => {
        alert('Booking Successful');
        // Optionally update the available classrooms
        // fetchAvailableClassrooms();
      });
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters(prev => ({ ...prev, [name]: value }));
  };

  // Define time slots
  const timeSlots = [
    '8:00 AM - 9:00 AM',
    '9:00 AM - 10:00 AM',
    '10:00 AM - 11:00 AM',
    '11:00 AM - 12:00 PM',
    '12:00 PM - 1:00 PM',
    '1:00 PM - 2:00 PM',
    '2:00 PM - 3:00 PM',
    '3:00 PM - 4:00 PM',
    '4:00 PM - 5:00 PM',
    '5:00 PM - 6:00 PM',
    '6:00 PM - 7:00 PM',
    '7:00 PM - 8:00 PM',
  ];

  const filteredClassrooms = classrooms.filter(classroom => 
    (filters.location === '' || classroom.location === filters.location) &&
    (filters.timeSlot === '' || classroom.availableTimes.includes(filters.timeSlot))
  );

  return (
    <Container className="App">
      <Typography variant="h2" gutterBottom>Classroom and Lab Booking</Typography>
      <Paper className="filter-section" elevation={3}>
        <Typography variant="h6">Filters</Typography>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6}>
            <InputLabel>Location</InputLabel>
            <Select
              name="location"
              value={filters.location}
              onChange={handleFilterChange}
              fullWidth
            >
              <MenuItem value="">Any</MenuItem>
              <MenuItem value="AB1">AB1</MenuItem>
              <MenuItem value="AB2">AB2</MenuItem>
              <MenuItem value="CB">CB</MenuItem>
            </Select>
          </Grid>
          <Grid item xs={12} sm={6}>
            <InputLabel>Time Slot</InputLabel>
            <Select
              name="timeSlot"
              value={filters.timeSlot}
              onChange={handleFilterChange}
              fullWidth
            >
              <MenuItem value="">Any</MenuItem>
              {timeSlots.map((slot, index) => (
                <MenuItem key={index} value={slot}>{slot}</MenuItem>
              ))}
            </Select>
          </Grid>
        </Grid>
      </Paper>
      <Paper className="classroom-list" elevation={3}>
        <Typography variant="h6">Available Classrooms and Labs</Typography>
        <List>
          {filteredClassrooms.map(classroom => (
            <ListItem key={classroom.id}>
              <ListItemText
                primary={`${classroom.name} - ${classroom.location}`}
                secondary={`Capacity: ${classroom.capacity} | Status: ${classroom.status} | Available Times: ${classroom.availableTimes.join(', ')}`}
              />
            </ListItem>
          ))}
        </List>
      </Paper>
      <Paper className="booking-form" elevation={3}>
        <Typography variant="h6">Book a Classroom</Typography>
        <form onSubmit={handleBookingSubmit}>
          <TextField
            label="Classroom ID"
            name="classroomId"
            value={booking.classroomId}
            onChange={handleBookingChange}
            fullWidth
            required
          />
          <TextField
            label="Start Time"
            name="startTime"
            type="datetime-local"
            value={booking.startTime}
            onChange={handleBookingChange}
            fullWidth
            required
            InputLabelProps={{ shrink: true }}
          />
          <TextField
            label="End Time"
            name="endTime"
            type="datetime-local"
            value={booking.endTime}
            onChange={handleBookingChange}
            fullWidth
            required
            InputLabelProps={{ shrink: true }}
          />
          <Button type="submit" variant="contained" color="primary" fullWidth>
            Book
          </Button>
        </form>
      </Paper>
    </Container>
  );
};

export default App;
